import ShopActionTypes from "./shop.types";

export const fetchShopData = (shopData) => {
  return {
    type: ShopActionTypes.FETCH_SHOP_DATA,
    payload: shopData,
  };
};

export const fetchCollectionStart = () => ({
  type: ShopActionTypes.FETCH_COLLECTION_START,
});
export const fetchCollectionSuccess = (collections) => ({
  type: ShopActionTypes.FETCH_COLLECTION_SUCCESS,
  payload: collections,
});

export const fetchCollectionFailed = (errorMessage) => ({
  type: ShopActionTypes.FETCH_COLLECTION_FAILED,
  payload: errorMessage,
});
